import React from "react";
import { Routes, Route, Navigate } from "react-router-dom";

import { AuthProvider } from "./Contexts/AuthContext.jsx";

import Profile from "./Components/UserSettingsViews/Profile";
import Clubs from "./Components/UserSettingsViews/Clubs/Clubs";
import Newsletter from "./Components/UserSettingsViews/Newsletter";
import ClubDetails from "./Components/UserSettingsViews/Clubs/ClubDetails";
import ClubManage from "./Components/UserSettingsViews/Clubs/ClubManage/ClubManage";
import OpportunityType from "./Components/PostOpportunity/OpportunityType";
import OpportunitySelect from "./Components/PostOpportunity/OpportunitySelect";
import OpportunityDetails from "./Components/PostOpportunity/OpportunityDetails";
import OpportunityCompany from "./Components/PostOpportunity/OpportunityCompany";
import CompanyDetails from "./Components/PostOpportunity/CompanyDetails";
import GroupSelect from "./Components/PostOpportunity/GroupSelect";
import DefaultLayout from "./Components/DefaultLayout";
import SettingsLayout from "./Components/SettingsLayout";
import Landing from "./Components/Landing/Landing";
import JoinClubs from "./Components/UserSettingsViews/Clubs/JoinClubs/JoinClubs";
import NoScrollLayout from "./Components/NoScrollLayout"

import ViewPosts from "./Components/ViewPosts/ViewPosts.jsx";
import SignUp from "./Pages/SignUp";
import SignIn from "./Pages/SignIn";
import NotFound from "./Pages/NotFound";
import { useMediaQuery } from "@mui/material";
import AddClub from "./Pages/AddClub";

import { Alert } from "@mui/material";
import InboundTermsOfService from "./Pages/InboundTOS";
import InboundPrivacyPolicy from "./Pages/PrivacyPolicy";
import TempMobile from "./Components/TempMobile";

function App() {
	const mobile = useMediaQuery("(min-width:900px)");
	if (!mobile) {
		return <TempMobile />;
	}
	return (
		<div className='App'>
			<AuthProvider>
				<Routes>
					<Route path='/' element={<DefaultLayout />}>
						<Route index element={<Landing />} />
					</Route>
					<Route path='*' element={<NotFound />} />
				</Routes>
			</AuthProvider>
		</div>
	);
}

export default App;
